import React from 'react'
import skills from '../images/skills.png'

function Todo() {
    return(
        <nav class="navbar navbar-light bg-light">
  <a class="navbar-brand" href="#">
  </a>
  <img src={skills} width="30" height="30" alt="" loading="lazy"></img>
</nav>
            
    )
}

export default Todo
